  <script>
    // Initialize AOS (Animate On Scroll)
    AOS.init({
      once: true,
      easing: 'ease-in-out',
      offset: 120,
      duration: 600
    });

    // Update floating navigation on scroll
    window.addEventListener('scroll', function () {
      const sections = document.querySelectorAll('.section');
      const navItems = document.querySelectorAll('.nav-item');

      let currentSection = '';
      sections.forEach(section => {
        const sectionTop = section.offsetTop;
        const sectionHeight = section.clientHeight;
        if (window.scrollY >= sectionTop - 200) {
          currentSection = section.id;
        }
      });

      navItems.forEach(item => {
        item.classList.remove('active');
        if (item.dataset.section === currentSection) {
          item.classList.add('active');
        }
      });
    });
  </script>

        attribution: '© <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'

        'January 2023', 'February 2023', 'March 2023', 'April 2023',
        'May 2023', 'June 2023', 'July 2023', 'August 2023',
        'September 2023', 'October 2023', 'November 2023', 'December 2023'

      let animationInterval;

      playButton.addEventListener('click', function () {

        playButton.classList.add('bg-gray-400');
        stopButton.classList.remove('bg-gray-200');
        stopButton.classList.add('bg-red-500', 'hover:bg-red-600');

        animationInterval = setInterval(function () {
          let nextMonth = parseInt(monthSlider.value) + 1;
          if (nextMonth > 11) nextMonth = 0;
          monthSlider.value = nextMonth;
          updateMonth();

      // Generate unique colors for each 'a3'
      const uniqueA3 = [...new Set(pointData.map(p => p.a3))];
      const colorMap = {};
      uniqueA3.forEach((name, index) => {
        const hue = (index * 137.5) % 360; // spread hues evenly
        colorMap[name] = `hsl(${hue}, 70%, 50%)`;
      });

      // Add individual circle markers directly to the map
      pointData.forEach(point => {
        const color = colorMap[point.a3];

        L.circleMarker([point.latitude, point.longitude], {
          radius: 5,
          color: color,
          fillColor: color,
          fillOpacity: 0.9,
          weight: 1
        })
        .addTo(map2)
        .bindPopup(`<strong>${point.a3}</strong><br/>ID: ${point._id}`);
      });
      
      const bounds = L.latLngBounds(pointData.map(p => [p.latitude, p.longitude]));
      map2.fitBounds(bounds);
    };

    // Initialize Visualizations
    document.addEventListener('DOMContentLoaded', () => {
      initMap();
    });
